export function insert_case3(n)
{
 const u = uncle(n);

 if ((u !== null) && (u.color === RED)) {
  n.parent.color = BLACK;
  u.color = BLACK;
  const g = grandparent(n);
  g.color = RED;
  insert_case1(g);
 } else {
  insert_case4(n);
 }
